INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 60000, 0, 1, 1, "", "カリン", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 60000, 0, 1, 2, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 60000, 0, 1, 3, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 60000, 0, 2, 4, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 60000, 0, 1, 5, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 60000, 0, 1, 6, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 60000, 0, 2, 7, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 60000, 0, 1, 8, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 60000, 0, 1, 9, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 60000, 0, 1, 10, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 60000, 0, 1, 11, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 60000, 0, 2, 12, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 60000, 0, 1, 13, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 60000, 0, 1, 14, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 60000, 0, 1, 15, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 60000, 0, 1, 16, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 60000, 0, 2, 17, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 60000, 0, 0, 18, "", "カリン", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 60000, 7, 0, 19, "", "カリン", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101201, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 80001, 1, 0, 20, "", "ハツネ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101201, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 80001, 1, 0, 21, "", "ハツネ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103801, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 80001, 1, 0, 22, "", "シオリ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103801, "来年も、\n一緒にいられたら…\nうれしいな", 1, 80001, 1, 0, 23, "", "シオリ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103601, "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 80001, 2, 0, 24, "", "キョウカ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103601, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 80001, 2, 0, 25, "", "キョウカ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102001, "おにいちゃんとあってから、\n1年たったよ～！", 1, 80001, 2, 0, 26, "", "ミミ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102001, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 1, 80001, 2, 0, 27, "", "ミミ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100401, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 80001, 2, 0, 28, "", "ミソギ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100401, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 80001, 2, 0, 29, "", "ミソギ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101001, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 80001, 3, 0, 30, "", "マホ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101001, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 80001, 3, 0, 31, "", "マホ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104401, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 80001, 3, 0, 32, "", "イリヤ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104401, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 1, 80001, 3, 0, 33, "", "イリヤ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101701, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 2, 80001, 3, 0, 34, "", "カオリ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101701, "これからも、どうぞよろしく\nお願いするさ～！", 2, 80001, 3, 0, 35, "", "カオリ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102801, "あんたと出会ってからもうそんなに\nたつのね～", 0, 80001, 4, 0, 36, "", "サレン", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102801, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 80001, 4, 0, 37, "", "サレン", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102501, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 80001, 4, 0, 38, "", "スズメ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102501, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 1, 80001, 4, 0, 39, "", "スズメ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104601, "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 80001, 5, 0, 40, "", "タマキ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104601, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 80001, 5, 0, 41, "", "タマキ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104801, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 80001, 5, 0, 42, "", "ミフユ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104801, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 1, 80001, 5, 0, 43, "", "ミフユ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103201, "あなたさまと出会ってもう1年…", 0, 80001, 6, 0, 44, "", "アキノ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103201, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 80001, 6, 0, 45, "", "アキノ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103401, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 80001, 6, 0, 46, "", "ユカリ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103401, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 1, 80001, 6, 0, 47, "", "ユカリ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (107101, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 80001, 7, 0, 48, "", "クリスティーナ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (107101, "ともかくこれからも\n愉しませてくれよ☆", 0, 80001, 7, 0, 49, "", "クリスティーナ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104701, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 80001, 7, 0, 50, "", "ジュン", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104701, "見えないから分からないって？\nそれもそうだな…", 1, 80001, 7, 0, 51, "", "ジュン", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103701, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 80001, 8, 0, 52, "", "トモ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103701, "これからもよろしくね！", 0, 80001, 8, 0, 53, "", "トモ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100501, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 80001, 8, 0, 54, "", "マツリ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100501, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 1, 80001, 8, 0, 55, "", "マツリ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100701, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 80001, 9, 0, 56, "", "ミヤコ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100701, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 80001, 9, 0, 57, "", "ミヤコ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103101, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 80001, 9, 0, 58, "", "シノブ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (103101, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 1, 80001, 9, 0, 59, "", "シノブ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100901, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 80001, 10, 0, 60, "", "アンナ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100901, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 80001, 10, 0, 61, "", "アンナ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101301, "君と出会ってもう1年だって！\n早いねー！", 1, 80001, 10, 0, 62, "", "ナナカ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101301, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 1, 80001, 10, 0, 63, "", "ナナカ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105101, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 80001, 11, 0, 64, "", "ミツキ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105101, "これからも、いろんなところを\n調べさせてね？", 0, 80001, 11, 0, 65, "", "ミツキ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105601, "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 80001, 11, 0, 66, "", "ルカ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105601, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 1, 80001, 11, 0, 67, "", "ルカ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102701, "早いものですわね、あなた様と\nお会いして、もう1年…", 2, 80001, 11, 0, 68, "", "エリコ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102701, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 80001, 11, 0, 69, "", "エリコ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102301, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 80001, 12, 0, 70, "", "アヤネ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102301, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 80001, 12, 0, 71, "", "アヤネ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104201, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 80001, 12, 0, 72, "", "チカ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104201, "私のことを見守ってください\nできることなら、ずっと…", 1, 80001, 12, 0, 73, "", "チカ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102101, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 2, 80001, 12, 0, 74, "", "クルミ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (102101, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 80001, 12, 0, 75, "", "クルミ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104901, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 80001, 13, 0, 76, "", "シズル", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (104901, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 80001, 13, 0, 77, "", "シズル", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101101, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 80001, 13, 0, 78, "", "リノ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (101101, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 1, 80001, 13, 0, 79, "", "リノ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100201, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 80001, 14, 0, 80, "", "ユイ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100201, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 80001, 14, 0, 81, "", "ユイ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100101, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 80001, 14, 0, 82, "", "ヒヨリ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100101, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 1, 80001, 14, 0, 83, "", "ヒヨリ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100301, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 2, 80001, 14, 0, 84, "", "レイ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (100301, "キミに背中を預けられる日が、\n早くきますように", 2, 80001, 14, 0, 85, "", "レイ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 80001, 15, 0, 86, "", "ペコリーヌ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "これからもずっと、覚えていて\nくださいね！", 0, 80001, 15, 0, 87, "", "ペコリーヌ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 80001, 15, 0, 88, "", "コッコロ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 1, 80001, 15, 0, 89, "", "コッコロ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 2, 80001, 15, 0, 90, "", "キャル", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 80001, 15, 0, 91, "", "キャル", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (112101, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 60001, 0, 1, 92, "", "スズメ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 60001, 0, 1, 93, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 60001, 0, 1, 94, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 60001, 0, 1, 95, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 60001, 0, 1, 96, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 60001, 0, 2, 97, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 60001, 0, 1, 98, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 60001, 0, 1, 99, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 60001, 0, 1, 100, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 60001, 0, 1, 101, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 60001, 0, 2, 102, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 60001, 0, 1, 103, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 60001, 0, 1, 104, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 60001, 0, 1, 105, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 60001, 0, 1, 106, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 2, 60001, 0, 1, 107, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 2, 60001, 0, 1, 108, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 60001, 0, 2, 109, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 60001, 0, 1, 110, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 60001, 0, 1, 111, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 60001, 0, 1, 112, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 60001, 0, 1, 113, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 60001, 0, 1, 114, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 2, 60001, 0, 1, 115, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 60001, 0, 2, 116, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (112101, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 3, 60001, 0, 0, 117, "", "スズメ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (112101, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 60001, 7, 0, 118, "", "スズメ", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "ヒューヒュー♪\nドンドンパフパフー♪", 0, 80003, 1, 0, 119, "", "ペコリーヌ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 80003, 1, 0, 120, "", "コッコロ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 80003, 1, 0, 121, "", "コッコロ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "え？　ちょっと\nいきなりなにっ？", 2, 80003, 1, 0, 122, "", "キャル", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 80003, 1, 0, 123, "", "キャル", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 80003, 1, 0, 124, "", "ペコリーヌ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 80003, 1, 0, 125, "", "ペコリーヌ", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 80003, 1, 0, 126, "", "コッコロ", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 2, 80003, 1, 0, 127, "", "キャル", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 80003, 1, 0, 128, "", "コッコロ", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 80003, 1, 0, 129, "", "ペコリーヌ", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 2, 80003, 1, 0, 130, "", "キャル", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 80003, 1, 0, 131, "", "コッコロ", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 80003, 2, 0, 132, "", "キャル", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 80003, 2, 0, 133, "", "カリン", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "げっ…カリンじゃない\nなんでもないわよ！", 0, 80003, 2, 0, 134, "", "キャル", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 1, 80003, 2, 0, 135, "", "カリン", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 80003, 2, 0, 136, "", "キャル", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 1, 80003, 2, 0, 137, "", "カリン", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 80003, 2, 0, 138, "", "キャル", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 80003, 2, 0, 139, "", "キャル", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 1, 80003, 2, 0, 140, "", "カリン", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 80003, 2, 0, 141, "", "キャル", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 1, 80003, 2, 0, 142, "", "カリン", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 80003, 2, 0, 143, "", "キャル", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 80003, 3, 0, 144, "", "コッコロ", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 1, 80003, 3, 0, 145, "", "ペコリーヌ", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 80003, 3, 0, 146, "", "コッコロ", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 80003, 3, 0, 147, "", "コッコロ", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 1, 80003, 3, 0, 148, "", "ペコリーヌ", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 1, 80003, 3, 0, 149, "", "ペコリーヌ", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 80003, 3, 0, 150, "", "コッコロ", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 1, 80003, 3, 0, 151, "", "ペコリーヌ", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 80003, 3, 0, 152, "", "コッコロ", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "えへへ、ありがとうございます\nコッコロちゃん！", 1, 80003, 3, 0, 153, "", "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 80003, 3, 0, 154, "", "コッコロ", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 1, 80003, 3, 0, 155, "", "ペコリーヌ", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 80003, 4, 0, 156, "", "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 1, 80003, 4, 0, 157, "", "キャル", 12, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 80003, 4, 0, 158, "", "ペコリーヌ", 12, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 1, 80003, 4, 0, 159, "", "キャル", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 80003, 4, 0, 160, "", "ペコリーヌ", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "…積極的？\nなんの話よ？", 1, 80003, 4, 0, 161, "", "キャル", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 80003, 4, 0, 162, "", "ペコリーヌ", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 80003, 4, 0, 163, "", "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 1, 80003, 4, 0, 164, "", "キャル", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 80003, 4, 0, 165, "", "ペコリーヌ", 16, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 1, 80003, 4, 0, 166, "", "キャル", 16, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 1, 80003, 4, 0, 167, "", "キャル", 17, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 80003, 5, 0, 168, "", "キャル", 18, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 1, 80003, 5, 0, 169, "", "コッコロ", 12, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 80003, 5, 0, 170, "", "キャル", 19, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 1, 80003, 5, 0, 171, "", "コッコロ", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 80003, 5, 0, 172, "", "キャル", 20, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 1, 80003, 5, 0, 173, "", "コッコロ", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 80003, 5, 0, 174, "", "キャル", 21, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 1, 80003, 5, 0, 175, "", "コッコロ", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "かくし芸？", 0, 80003, 5, 0, 176, "", "キャル", 22, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 1, 80003, 5, 0, 177, "", "コッコロ", 16, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 80003, 5, 0, 178, "", "キャル", 23, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 80003, 6, 0, 179, "", "ペコリーヌ", 17, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 2, 80003, 6, 0, 180, "", "キャル", 24, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 1, 80003, 6, 0, 181, "", "コッコロ", 17, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 80003, 6, 0, 182, "", "ペコリーヌ", 18, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 2, 80003, 6, 0, 183, "", "キャル", 25, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 1, 80003, 6, 0, 184, "", "コッコロ", 18, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 2, 80003, 6, 0, 185, "", "キャル", 26, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 2, 80003, 6, 0, 186, "", "キャル", 27, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 2, 80003, 6, 0, 187, "", "キャル", 28, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 80003, 6, 0, 188, "", "ペコリーヌ", 19, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 1, 80003, 6, 0, 189, "", "コッコロ", 19, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 2, 80003, 6, 0, 190, "", "キャル", 29, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 80003, 7, 0, 191, "", "キャル", 30, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 80003, 7, 0, 192, "", "キャル", 31, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 80003, 7, 0, 193, "", "キャル", 32, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あー\nあー\n…声、これで大丈夫かしら？", 0, 80003, 7, 0, 194, "", "キャル", 33, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 80003, 7, 0, 195, "", "キャル", 34, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "オイッスー☆", 0, 80003, 7, 0, 196, "", "キャル", 35, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 80003, 7, 0, 197, "", "キャル", 36, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 80003, 7, 0, 198, "", "キャル", 37, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 80003, 7, 0, 199, "", "キャル", 38, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 80003, 8, 0, 200, "", "コッコロ", 20, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 80003, 8, 0, 201, "", "コッコロ", 21, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 80003, 8, 0, 202, "", "コッコロ", 22, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 80003, 8, 0, 203, "", "コッコロ", 23, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 80003, 8, 0, 204, "", "コッコロ", 24, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "オイッスー☆", 0, 80003, 8, 0, 205, "", "コッコロ", 25, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 80003, 8, 0, 206, "", "コッコロ", 26, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 80003, 8, 0, 207, "", "コッコロ", 27, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 80003, 8, 0, 208, "", "コッコロ", 28, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "オイッスー☆", 0, 80003, 9, 0, 209, "", "ペコリーヌ", 20, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 80003, 9, 0, 210, "", "ペコリーヌ", 21, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あと６日で2.5周年ですか…", 0, 80003, 9, 0, 211, "", "ペコリーヌ", 22, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 80003, 9, 0, 212, "", "ペコリーヌ", 23, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 80003, 9, 0, 213, "", "ペコリーヌ", 24, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "オイッスー☆", 0, 80003, 9, 0, 214, "", "ペコリーヌ", 25, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 80003, 9, 0, 215, "", "ペコリーヌ", 26, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 80003, 9, 0, 216, "", "ペコリーヌ", 27, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 80003, 9, 0, 217, "", "ペコリーヌ", 28, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 80003, 9, 0, 218, "", "ペコリーヌ", 29, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 80003, 9, 0, 219, "", "ペコリーヌ", 30, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 80003, 10, 0, 220, "", "ペコリーヌ", 31, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 1, 80003, 10, 0, 221, "", "コッコロ", 29, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 80003, 10, 0, 222, "", "ペコリーヌ", 32, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "…………", 2, 80003, 10, 0, 223, "", "キャル", 39, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 1, 80003, 10, 0, 224, "", "コッコロ", 30, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 2, 80003, 10, 0, 225, "", "キャル", 40, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 80003, 10, 0, 226, "", "ペコリーヌ", 33, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 2, 80003, 10, 0, 227, "", "キャル", 41, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 80003, 10, 0, 228, "", "ペコリーヌ", 34, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 80003, 10, 0, 229, "", "ペコリーヌ", 35, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 2, 80003, 10, 0, 230, "", "キャル", 42, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 1, 80003, 10, 0, 231, "", "コッコロ", 31, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 2, 80003, 10, 0, 232, "", "キャル", 43, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 80003, 10, 0, 233, "", "ペコリーヌ", 36, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 80003, 11, 0, 234, "", "カリン", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 80003, 11, 0, 235, "", "カリン", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 80003, 11, 0, 236, "", "カリン", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 80003, 11, 0, 237, "", "カリン", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 80003, 11, 0, 238, "", "カリン", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "次にコッコロさんですが\nこちらは発声練習をしています", 0, 80003, 11, 0, 239, "", "カリン", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 80003, 11, 0, 240, "", "カリン", 12, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 80003, 11, 0, 241, "", "カリン", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "あれ？\nもしかして緊張で気を失って…？", 0, 80003, 11, 0, 242, "", "カリン", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 80003, 11, 0, 243, "", "カリン", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 80003, 11, 0, 244, "", "カリン", 16, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "それでは\nまた明日お会いしましょう♪", 0, 80003, 11, 0, 245, "", "カリン", 17, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 80003, 12, 0, 246, "", "キャル", 44, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 2, 80003, 12, 0, 247, "", "ペコリーヌ", 37, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 1, 80003, 12, 0, 248, "", "コッコロ", 32, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 80003, 12, 0, 249, "", "キャル", 45, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "ひどいですよぉキャルちゃ～ん！", 2, 80003, 12, 0, 250, "", "ペコリーヌ", 38, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 1, 80003, 12, 0, 251, "", "コッコロ", 33, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 2, 80003, 12, 0, 252, "", "ペコリーヌ", 39, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 80003, 12, 0, 253, "", "キャル", 46, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 1, 80003, 12, 0, 254, "", "コッコロ", 34, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 2, 80003, 12, 0, 255, "", "ペコリーヌ", 40, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 80003, 13, 0, 256, "", "ペコリーヌ", 41, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 2, 80003, 13, 0, 257, "", "キャル", 47, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "忘れてきちゃいました☆", 0, 80003, 13, 0, 258, "", "ペコリーヌ", 42, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 2, 80003, 13, 0, 259, "", "キャル", 48, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 1, 80003, 13, 0, 260, "", "コッコロ", 35, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 2, 80003, 13, 0, 261, "", "キャル", 49, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 80003, 13, 0, 262, "", "ペコリーヌ", 43, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 2, 80003, 13, 0, 263, "", "キャル", 50, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 1, 80003, 13, 0, 264, "", "コッコロ", 36, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 2, 80003, 13, 0, 265, "", "キャル", 51, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 1, 80003, 13, 0, 266, "", "コッコロ", 37, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 2, 80003, 13, 0, 267, "", "キャル", 52, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 80003, 13, 0, 268, "", "ペコリーヌ", 44, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 1, 80003, 13, 0, 269, "", "コッコロ", 38, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 80003, 13, 0, 270, "", "ペコリーヌ", 45, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 2, 80003, 13, 0, 271, "", "キャル", 53, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 80003, 13, 0, 272, "", "ペコリーヌ", 46, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "こんにちは\n【ギルド管理協会】のカリンです", 0, 80003, 14, 0, 273, "", "カリン", 18, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "昨日の生放送は\nいかがだったでしょうか？", 0, 80003, 14, 0, 274, "", "カリン", 19, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 80003, 14, 0, 275, "", "カリン", 20, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 80003, 14, 0, 276, "", "カリン", 21, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 80003, 14, 0, 277, "", "カリン", 22, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 80003, 14, 0, 278, "", "カリン", 23, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 80003, 14, 0, 279, "", "カリン", 24, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 80003, 14, 0, 280, "", "カリン", 25, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 80003, 14, 0, 281, "", "カリン", 26, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 80003, 14, 0, 282, "", "カリン", 27, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "準備はいいですかっ？\n…いっきますよー！", 0, 80003, 15, 0, 283, "", "ペコリーヌ", 47, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "祝！", 2, 80003, 15, 0, 284, "", "キャル", 54, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "2.5周年！", 1, 80003, 15, 0, 285, "", "コッコロ", 39, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "おめでとうございま～す☆", 0, 80003, 15, 0, 286, "", "ペコリーヌ", 48, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 2, 80003, 15, 0, 287, "", "キャル", 55, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 1, 80003, 15, 0, 288, "", "コッコロ", 40, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 80003, 15, 0, 289, "", "ペコリーヌ", 49, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 2, 80003, 15, 0, 290, "", "キャル", 56, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 1, 80003, 15, 0, 291, "", "コッコロ", 41, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 2, 80003, 15, 0, 292, "", "キャル", 57, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 80003, 15, 0, 293, "", "ペコリーヌ", 50, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 2, 80003, 15, 0, 294, "", "キャル", 58, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "記念日だから\n平気平気♪\nやばいですね☆", 0, 80003, 15, 0, 295, "", "ペコリーヌ", 51, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "意味分かんないわよ！", 2, 80003, 15, 0, 296, "", "キャル", 59, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 1, 80003, 15, 0, 297, "", "コッコロ", 42, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 1, 80003, 15, 0, 298, "", "コッコロ", 43, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 80003, 15, 0, 299, "", "ペコリーヌ", 52, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 2, 80003, 15, 0, 300, "", "キャル", 60, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 1, 80003, 15, 0, 301, "", "コッコロ", 44, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 80003, 15, 0, 302, "", "ペコリーヌ", 53, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "2.5周年\nありがとうございます！", 0, 80003, 15, 0, 303, "105901,45,106001,61", "ペコリーヌ・コッコロ・キャル", 54, 1, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 60002, 0, 1, 304, "", "カリン", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 60002, 0, 1, 305, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 60002, 0, 1, 306, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 60002, 0, 1, 307, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 60002, 0, 1, 308, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 60002, 0, 2, 309, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 60002, 0, 1, 310, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 60002, 0, 1, 311, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 60002, 0, 1, 312, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 60002, 0, 1, 313, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 60002, 0, 2, 314, "", "", 0, 0, 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 2, 60002, 0, 1, 315, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 2, 60002, 0, 1, 316, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 60002, 0, 1, 317, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 2, 60002, 0, 1, 318, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 2, 60002, 0, 1, 319, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 60002, 0, 1, 320, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2, 60002, 0, 2, 321, "", "", 0, 0, 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 2, 60002, 0, 1, 322, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 60002, 0, 1, 323, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 2, 60002, 0, 1, 324, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 60002, 0, 1, 325, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 60002, 0, 1, 326, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 2, 60002, 0, 1, 327, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 60002, 0, 2, 328, "", "", 0, 0, 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 60002, 0, 0, 329, "", "カリン", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 60002, 7, 0, 330, "", "カリン", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ささ、シェフィさまはこちらへ…", 4, 80005, 1, 0, 331, "", "コッコロ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "コッコロさん、どこへ行くの…？\n…え？", 0, 80005, 1, 0, 332, "", "シェフィ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 3, 80005, 1, 0, 333, "", "ペコリーヌ", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 4, 80005, 1, 0, 334, "", "コッコロ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "ええと…\n二人とも何をしているの？", 0, 80005, 1, 0, 335, "", "シェフィ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 80005, 1, 0, 336, "", "キャル", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "あの日…？", 0, 80005, 1, 0, 337, "", "シェフィ", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 3, 80005, 1, 0, 338, "", "ペコリーヌ", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 80005, 1, 0, 339, "", "ペコリーヌ", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "やばいですね☆", 2, 80005, 1, 0, 340, "", "カリン", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "って、なにしれっと\n参加してんのよカリン！", 1, 80005, 1, 0, 341, "", "キャル", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 80005, 1, 0, 342, "", "カリン", 2, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 2, 80005, 1, 0, 343, "", "カリン", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 3, 80005, 1, 0, 344, "", "ペコリーヌ", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 80005, 1, 0, 345, "", "シェフィ", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 3, 80005, 2, 0, 346, "", "ペコリーヌ", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 1, 80005, 2, 0, 347, "", "コッコロ", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 1, 80005, 2, 0, 348, "", "コッコロ", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 3, 80005, 2, 0, 349, "", "ペコリーヌ", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "さすがでございます\nペコリーヌさま", 1, 80005, 2, 0, 350, "", "コッコロ", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 80005, 2, 0, 351, "", "キャル", 3, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 80005, 2, 0, 352, "", "シェフィ", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 3, 80005, 2, 0, 353, "", "ペコリーヌ", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "さ、次はキャルさまの\n番でございますよ", 1, 80005, 2, 0, 354, "", "コッコロ", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 80005, 2, 0, 355, "", "キャル", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 80005, 2, 0, 356, "", "シェフィ", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 80005, 2, 0, 357, "", "キャル", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 80005, 2, 0, 358, "", "キャル", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 1, 80005, 2, 0, 359, "", "コッコロ", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 80005, 2, 0, 360, "", "キャル", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 1, 80005, 3, 0, 361, "", "コッコロ", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 80005, 3, 0, 362, "", "ペコリーヌ", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 1, 80005, 3, 0, 363, "", "コッコロ", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "聖学祭…って、なにかしら？", 2, 80005, 3, 0, 364, "", "シェフィ", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 1, 80005, 3, 0, 365, "", "コッコロ", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 80005, 3, 0, 366, "", "キャル", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 80005, 3, 0, 367, "", "キャル", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 80005, 3, 0, 368, "", "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "いや、そのまんますぎでしょ…", 0, 80005, 3, 0, 369, "", "キャル", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 2, 80005, 3, 0, 370, "", "シェフィ", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 80005, 3, 0, 371, "", "ペコリーヌ", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "えっ？　ええ…\nぎゅーっ…？", 2, 80005, 3, 0, 372, "", "シェフィ", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 80005, 4, 0, 373, "", "キャル", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 2, 80005, 4, 0, 374, "", "シェフィ", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 80005, 4, 0, 375, "", "キャル", 12, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 1, 80005, 4, 0, 376, "", "コッコロ", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 80005, 4, 0, 377, "", "キャル", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 3, 80005, 4, 0, 378, "", "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 80005, 4, 0, 379, "", "キャル", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 80005, 4, 0, 380, "", "キャル", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 2, 80005, 4, 0, 381, "", "シェフィ", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 3, 80005, 4, 0, 382, "", "ペコリーヌ", 12, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 1, 80005, 4, 0, 383, "", "コッコロ", 12, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 80005, 4, 0, 384, "", "キャル", 16, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 2, 80005, 4, 0, 385, "", "シェフィ", 12, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 3, 80005, 5, 0, 386, "", "ペコリーヌ", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 3, 80005, 5, 0, 387, "", "ペコリーヌ", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 3, 80005, 5, 0, 388, "", "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 80005, 5, 0, 389, "", "キャル", 17, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 80005, 5, 0, 390, "", "キャル", 18, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 2, 80005, 5, 0, 391, "", "シェフィ", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 1, 80005, 5, 0, 392, "", "コッコロ", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 3, 80005, 5, 0, 393, "", "ペコリーヌ", 16, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 80005, 5, 0, 394, "", "キャル", 19, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 3, 80005, 5, 0, 395, "", "ペコリーヌ", 17, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 3, 80005, 5, 0, 396, "", "ペコリーヌ", 18, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 3, 80005, 5, 0, 397, "", "ペコリーヌ", 19, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 2, 80005, 6, 0, 398, "", "カリン", 4, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 2, 80005, 6, 0, 399, "", "カリン", 5, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "…えっ！？", 1, 80005, 6, 0, 400, "", "キャル", 20, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 3, 80005, 6, 0, 401, "", "ペコリーヌ", 20, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 80005, 6, 0, 402, "", "シェフィ", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 4, 80005, 6, 0, 403, "", "コッコロ", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 80005, 6, 0, 404, "", "シェフィ", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 1, 80005, 6, 0, 405, "", "キャル", 21, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 3, 80005, 6, 0, 406, "", "ペコリーヌ", 21, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ぶっ殺すぞ！？", 1, 80005, 6, 0, 407, "", "キャル", 22, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 2, 80005, 6, 0, 408, "", "カリン", 6, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 1, 80005, 7, 0, 409, "", "コッコロ", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 80005, 7, 0, 410, "", "キャル", 23, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 2, 80005, 7, 0, 411, "", "シェフィ", 16, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 3, 80005, 7, 0, 412, "", "ペコリーヌ", 22, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 80005, 7, 0, 413, "", "キャル", 24, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 2, 80005, 7, 0, 414, "", "シェフィ", 17, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 1, 80005, 7, 0, 415, "", "コッコロ", 16, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 2, 80005, 7, 0, 416, "", "シェフィ", 18, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "もちろんでございます\n仲良くお勉強いたしましょう", 1, 80005, 7, 0, 417, "", "コッコロ", 17, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "しれっと教育ママが\n生まれてる…？", 0, 80005, 7, 0, 418, "", "キャル", 25, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 3, 80005, 7, 0, 419, "", "ペコリーヌ", 23, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "え～～～～！？", 0, 80005, 7, 0, 420, "", "キャル", 26, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 80005, 8, 0, 421, "", "キャル", 27, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 2, 80005, 8, 0, 422, "", "シェフィ", 19, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 1, 80005, 8, 0, 423, "", "コッコロ", 18, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 3, 80005, 8, 0, 424, "", "ペコリーヌ", 24, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 2, 80005, 8, 0, 425, "", "シェフィ", 20, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 80005, 8, 0, 426, "", "キャル", 28, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 1, 80005, 8, 0, 427, "", "コッコロ", 19, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 2, 80005, 8, 0, 428, "", "シェフィ", 21, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 80005, 8, 0, 429, "", "キャル", 29, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 80005, 8, 0, 430, "", "キャル", 30, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 3, 80005, 8, 0, 431, "", "ペコリーヌ", 25, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 80005, 8, 0, 432, "", "キャル", 31, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 80005, 9, 0, 433, "", "シェフィ", 22, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 80005, 9, 0, 434, "", "シェフィ", 23, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 80005, 9, 0, 435, "", "シェフィ", 24, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 80005, 9, 0, 436, "", "シェフィ", 25, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 80005, 9, 0, 437, "", "シェフィ", 26, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "それから、それから…！\nぅ、ぅぅっ…！", 0, 80005, 9, 0, 438, "", "シェフィ", 27, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "―びえぇぇ～んっ！！！", 0, 80005, 9, 0, 439, "", "シェフィ", 28, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "どうされましたか、シェフィさま", 1, 80005, 9, 0, 440, "", "コッコロ", 20, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "ううっ…ひっく…\nママッ…！", 0, 80005, 9, 0, 441, "", "シェフィ", 29, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 1, 80005, 9, 0, 442, "", "コッコロ", 21, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 1, 80005, 9, 0, 443, "", "コッコロ", 22, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 80005, 9, 0, 444, "", "シェフィ", 30, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "主さま\n3.5周年まであと５日\nでございます", 0, 80005, 10, 0, 445, "", "コッコロ", 23, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ですがその前に\n生放送がありますね", 0, 80005, 10, 0, 446, "", "コッコロ", 24, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "…生放送に向けた\n意気込みでございますか？", 0, 80005, 10, 0, 447, "", "コッコロ", 25, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 80005, 10, 0, 448, "", "コッコロ", 26, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 80005, 10, 0, 449, "", "コッコロ", 27, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 80005, 10, 0, 450, "", "コッコロ", 28, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 80005, 10, 0, 451, "", "コッコロ", 29, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 80005, 10, 0, 452, "", "コッコロ", 30, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 80005, 10, 0, 453, "", "コッコロ", 31, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "3.5周年まであと４日！\nやばいですね☆", 0, 80005, 11, 0, 454, "", "ペコリーヌ", 26, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 1, 80005, 11, 0, 455, "", "キャル", 32, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 80005, 11, 0, 456, "", "ペコリーヌ", 27, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 80005, 11, 0, 457, "", "ペコリーヌ", 28, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 80005, 11, 0, 458, "", "ペコリーヌ", 29, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 1, 80005, 11, 0, 459, "", "キャル", 33, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 80005, 11, 0, 460, "", "ペコリーヌ", 30, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 80005, 11, 0, 461, "", "ペコリーヌ", 31, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 80005, 11, 0, 462, "", "ペコリーヌ", 32, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "だからあたしはやるなんて一言も…", 1, 80005, 11, 0, 463, "", "キャル", 34, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "オイッスー☆", 0, 80005, 11, 0, 464, "", "ペコリーヌ", 33, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "聞きなさいっての！！", 1, 80005, 11, 0, 465, "", "キャル", 35, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "3.5周年まであと３日…\nそして生放送は、明日…", 2, 80005, 12, 0, 466, "", "シェフィ", 31, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 2, 80005, 12, 0, 467, "", "シェフィ", 32, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "おいっす！\n…こうじゃなかったわね\nええと確か…", 2, 80005, 12, 0, 468, "", "シェフィ", 33, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 2, 80005, 12, 0, 469, "", "シェフィ", 34, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 2, 80005, 12, 0, 470, "", "シェフィ", 35, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "やってますねシェフィちゃん！", 3, 80005, 12, 0, 471, "", "ペコリーヌ", 34, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "なによ、考えることは\nみんな同じってこと？", 0, 80005, 12, 0, 472, "", "キャル", 36, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 1, 80005, 12, 0, 473, "", "コッコロ", 32, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "みんな…もちろんよ！", 2, 80005, 12, 0, 474, "", "シェフィ", 36, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 3, 80005, 12, 0, 475, "", "ペコリーヌ", 35, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 2, 80005, 13, 0, 476, "", "カリン", 7, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 2, 80005, 13, 0, 477, "", "カリン", 8, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 3, 80005, 13, 0, 478, "", "ペコリーヌ", 36, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 2, 80005, 13, 0, 479, "", "カリン", 9, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 4, 80005, 13, 0, 480, "", "コッコロ", 33, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 2, 80005, 13, 0, 481, "", "カリン", 10, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "大丈夫…大丈夫…\nあたしは大丈夫…", 1, 80005, 13, 0, 482, "", "キャル", 37, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 2, 80005, 13, 0, 483, "", "カリン", 11, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "あうー？", 0, 80005, 13, 0, 484, "", "シェフィ", 37, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "あ…", 4, 80005, 13, 0, 485, "105901,34,106001,38,190801,12", "みんな", 37, 1, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 1, 80005, 13, 0, 486, "", "キャル", 39, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 4, 80005, 13, 0, 487, "", "コッコロ", 35, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 3, 80005, 13, 0, 488, "", "ペコリーヌ", 38, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 2, 80005, 13, 0, 489, "", "カリン", 13, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 2, 80005, 14, 0, 490, "", "シェフィ", 38, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 3, 80005, 14, 0, 491, "", "ペコリーヌ", 39, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 80005, 14, 0, 492, "", "キャル", 40, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 1, 80005, 14, 0, 493, "", "コッコロ", 36, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 2, 80005, 14, 0, 494, "", "シェフィ", 39, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 3, 80005, 14, 0, 495, "", "ペコリーヌ", 40, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 1, 80005, 14, 0, 496, "", "コッコロ", 37, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 80005, 14, 0, 497, "", "キャル", 41, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "へ、へぇ…", 2, 80005, 14, 0, 498, "", "シェフィ", 40, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 3, 80005, 14, 0, 499, "", "ペコリーヌ", 41, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 2, 80005, 14, 0, 500, "", "シェフィ", 41, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 2, 80005, 14, 0, 501, "", "シェフィ", 42, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 3, 80005, 15, 0, 502, "", "ペコリーヌ", 42, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "祝！", 1, 80005, 15, 0, 503, "", "キャル", 42, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "3.5周年！", 4, 80005, 15, 0, 504, "", "コッコロ", 38, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "おめでとうございます！", 0, 80005, 15, 0, 505, "", "シェフィ", 43, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 2, 80005, 15, 0, 506, "", "カリン", 14, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190801, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 2, 80005, 15, 0, 507, "", "カリン", 15, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 3, 80005, 15, 0, 508, "", "ペコリーヌ", 43, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 3, 80005, 15, 0, 509, "", "ペコリーヌ", 44, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 1, 80005, 15, 0, 510, "", "キャル", 43, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106001, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 1, 80005, 15, 0, 511, "", "キャル", 44, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 80005, 15, 0, 512, "", "シェフィ", 44, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (106401, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 80005, 15, 0, 513, "", "シェフィ", 45, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 4, 80005, 15, 0, 514, "", "コッコロ", 39, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 4, 80005, 15, 0, 515, "", "コッコロ", 40, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105901, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 4, 80005, 15, 0, 516, "", "コッコロ", 41, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 3, 80005, 15, 0, 517, "", "ペコリーヌ", 45, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (105801, "これからも\nよろしくおねがいします！", 4, 80005, 15, 0, 518, "105901,42,106001,45,106401,46,190801,16", "みんな", 46, 1, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 60003, 0, 1, 519, "", "カリン", 1, 0, 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 60003, 0, 1, 520, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 60003, 0, 1, 521, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 2, 60003, 0, 1, 522, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 2, 60003, 0, 1, 523, "", "", 0, 0, 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 60003, 0, 2, 524, "", "", 0, 0, 1);
