INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 60005, 0, 1, 594, "", "", 0, 0, 4);
