INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 2, 60005, 0, 2, 597, "", "", 0, 0, 4);
